import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Extract visible user profile data
    await page.waitForSelector('input[placeholder="Email or phone number"]');
    const email = await page.$eval('input[placeholder="Email or phone number"]', el => el.value);

    await page.waitForSelector('input[placeholder="Password"]');
    const password = await page.$eval('input[placeholder="Password"]', el => el.value);

    // Assuming we want to extract the first name and last name from the signup form
    await page.waitForSelector('input[placeholder="First name"]');
    const firstName = await page.$eval('input[placeholder="First name"]', el => el.value);

    await page.waitForSelector('input[placeholder="Last name"]');
    const lastName = await page.$eval('input[placeholder="Last name"]', el => el.value);

    // Take a screenshot after extracting data
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_data_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_data_extracted.png'));

    // Return extracted data
    return {
      success: true,
      action: "Extracted visible user profile data",
      extractedData: {
        email,
        password,
        firstName,
        lastName
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

